pragma solidity ^0.6.2;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

// The ERC721 contract. It is ownable for the case of the setWinner, that will be called in the backend, so
// it should be called only by the owner or maybe by a designer operator
contract Satoshi721 is ERC721, Ownable {
    using Counters for Counters.Counter;
    Counters.Counter private _tokenIds;

    // Emit this event when a royalty is generated
    event Royalty(address indexed artist, uint256 _value);
    event Payment(address indexed artist, uint256 _value);

    // data of the token
    struct TokenData {
        uint256 price;
        address payable creator;
        bool isDropOfTheDay;
        bool onSale;
        uint256 royalties;
    }
    // the token data is saved on a mapping, having the token id as key
    mapping(uint256 => TokenData) public tokens;

    // Auctions data. As there will be an auction for celebrities with timing of 10-30 minutes the auction will be handled offchain
    struct Auction {
        address creator;
        address bestBidder;
        uint256 bestBidAmount;
        uint256 startTime;
        uint256 duration;
        uint256 minimumPrice;
    }
    // the key is the tokenId, so only one auction per token is allowed
    mapping(uint256 => Auction) public auctions;

    address payable platform;
    uint256 bpArtists = 9750; // 94.00 in basis points (parts per 10,000)
    uint256 bpPlatform = 250; // 6% for the platform
    uint256 bpDropOfDay = 2500; // the drop of the day will have a commision of 25%, modificable by the admin

    constructor() public ERC721("Luis NFT", "LUIS") {}

    // Mints the NFT and save the data into the tokens mapping. By default the token is not on sale
    function createItem(
        string memory tokenURI, // URI pointing to the art
        uint256 _price, // price in weis of the token
        uint256 _royalties // royalties assigned to the token by the creator, in bps
    ) public returns (uint256) {
        require(_royalties <= 200, "Royalties too high"); // limit is 2% for royalties

        _tokenIds.increment();

        uint256 newItemId = _tokenIds.current();
        _mint(msg.sender, newItemId);
        _setTokenURI(newItemId, tokenURI);

        tokens[newItemId] = TokenData({
            price: _price,
            creator: msg.sender,
            isDropOfTheDay: false,
            onSale: false,
            royalties: _royalties
        });

        emit Approval(msg.sender, address(this), newItemId);

        return newItemId;
    }

    // sets an existing token as "onsale"
    function putOnSale(uint256 _id) public {
        TokenData memory token = tokens[_id];

        require(
            msg.sender == ownerOf(_id),
            "Only owner can put an item on sale"
        );

        tokens[_id] = TokenData({
            price: token.price,
            creator: msg.sender,
            isDropOfTheDay: token.isDropOfTheDay,
            onSale: true,
            royalties: token.royalties
        });
    }

    // The owner (not sure about this for security reasons) is able to set a token as "drop of the day"
    // so the commision instead of 2.5% will be entered directly by the owner
    function setDropOfTheDay(uint256 _id, uint256 _commisionInBp)
        public
        onlyOwner
    {
        TokenData memory token = tokens[_id];

        /*  require(
            msg.sender == address(this),
            "Only owner can put an item as drop of the day"
        );*/

        tokens[_id] = TokenData({
            price: token.price,
            creator: msg.sender,
            isDropOfTheDay: true,
            onSale: true,
            royalties: token.royalties
        });
        // as only one drop of the day is allowed at the same time
        bpDropOfDay = _commisionInBp;
    }

    function createAndPutOnSale(
        string memory tokenURI, // URI pointing to the art
        uint256 _price, // price in weis of the token
        uint256 _royalties
    ) public returns (uint256) {
        require(_royalties <= 200, "Royalties too high"); // limit is 2% for royalties

        _tokenIds.increment();

        uint256 newItemId = _tokenIds.current();
        _mint(msg.sender, newItemId);
        _setTokenURI(newItemId, tokenURI);

        tokens[newItemId] = TokenData({
            price: _price,
            creator: msg.sender,
            isDropOfTheDay: false,
            onSale: true,
            royalties: _royalties
        });

        emit Approval(msg.sender, address(this), newItemId);

        return newItemId;
    }

    function buy(uint256 _tokenId) external payable {
        address buyer = msg.sender;
        uint256 payedPrice = msg.value;
        address payable currentOwner = payable(ownerOf(_tokenId));
        TokenData memory token = tokens[_tokenId];
        require(token.onSale == true, "Token is not for sale");
        uint256 price = token.price;
        require(payedPrice >= price, "Amount is not enough");
        require(token.isDropOfTheDay != true);
        address payable creator = token.creator;
        uint256 commision = bpArtists;
        if (token.isDropOfTheDay == true) commision = (10000 - bpDropOfDay);
        if (ownerOf(_tokenId) == creator) {
            {
                creator.transfer((payedPrice * commision) / 10000);
                emit Payment(creator, (payedPrice * commision) / 10000);
            }
        } else {
            // Resale, so transfer also royalties, that are substracted from buyer commision
            uint256 royalties = tokens[_tokenId].royalties;
            currentOwner.transfer(
                (payedPrice * (commision - royalties)) / 10000
            );
            emit Payment(
                currentOwner,
                (payedPrice * commision - royalties) / 10000
            );
            creator.transfer((payedPrice * royalties) / 10000);
            emit Royalty(creator, (payedPrice * royalties) / 10000);
        }
        _transfer(ownerOf(_tokenId), buyer, _tokenId);
        tokens[_tokenId].onSale = false;
        tokens[_tokenId].isDropOfTheDay = false;
    }

    // The creator mints a token and set inmediatly an auction with it
    function CreateAndPutOnAuction(
        string memory _tokenURI, // URI pointing to the art
        uint256 _startDate,
        uint256 _durationInSeconds,
        uint256 _royalties
    ) public returns (uint256) {
        _tokenIds.increment();

        uint256 newItemId = _tokenIds.current();
        _mint(msg.sender, newItemId);
        _setTokenURI(newItemId, _tokenURI);
        // Add the token to the token list
        tokens[newItemId] = TokenData({
            creator: msg.sender,
            isDropOfTheDay: false,
            price: 0,
            onSale: true,
            royalties: _royalties
        });
        // add the token to the auction
        Auction memory auction =
            Auction({
                creator: msg.sender,
                minimumPrice: 0,
                bestBidAmount: 0,
                startTime: _startDate,
                duration: _durationInSeconds,
                bestBidder: address(0)
            });
        auctions[newItemId] = auction;
        return newItemId;
    }

    // Start an auction using a token (that must exists)
    function startAuction(
        uint256 _tokenId,
        uint256 _minAmount,
        uint256 _startDate,
        uint256 _durationInSeconds
    ) external {
        require(
            msg.sender == ownerOf(_tokenId) ||
                getApproved(_tokenId) == msg.sender,
            "Only the owner can set a token into an auction"
        );
        Auction memory auction =
            Auction({
                creator: msg.sender,
                minimumPrice: _minAmount,
                bestBidAmount: 0,
                startTime: _startDate,
                duration: _durationInSeconds,
                bestBidder: address(0)
            });
        auctions[_tokenId] = auction;
    }

    // Warning!! this method will be called from the backend to set the winner of an auction with the corresponding amount
    function setWinner(
        uint256 _tokenId,
        address _winner,
        uint256 _amount
    ) public returns (bool) {
        Auction storage auction = auctions[_tokenId];
        require(
            now > auction.startTime.add(auction.duration),
            "Auction still active"
        );
        require(_amount >= auction.minimumPrice, "Amount not high enough");
        auction.bestBidder = _winner;
        auction.bestBidAmount = _amount;
        auctions[_tokenId] = auction;
        return true;
    }

    // The winner of the bid should be able to claim the token
    function claim(uint256 _tokenId) external payable {
        Auction storage auction = auctions[_tokenId];
        require(msg.value == auction.bestBidAmount, "Amount is not enough");
        require(msg.sender == auction.bestBidder, "User is not the winner");
        require(
            msg.value >= auction.minimumPrice,
            "amount is lower that the minimum price"
        );

        address payable winner = msg.sender;
        uint256 payedPrice = msg.value;
        address payable currentOwner = payable(ownerOf(_tokenId));
        TokenData memory token = tokens[_tokenId];
        // By default the commision is the one for the artist (97.5%)
        uint256 commision = bpArtists;
        // but if the token is the drop of the day, the commision is 100%-commisionDropOfTheDay
        if (token.isDropOfTheDay == true) commision = (10000 - bpDropOfDay);
        // CASE 1. First sale
        if (ownerOf(_tokenId) == token.creator) {
            token.creator.transfer((payedPrice * commision) / 10000);
            emit Payment(token.creator, (payedPrice * commision) / 10000);
        } else {
            // CASE 2. Resale
            uint256 royalties = tokens[_tokenId].royalties;
            currentOwner.transfer((payedPrice * (commision - royalties)) / 10000);
            emit Payment(
                currentOwner,
                (payedPrice * commision - royalties) / 10000
            );
            token.creator.transfer((payedPrice * royalties) / 10000);
            emit Royalty(token.creator, (payedPrice * royalties) / 10000);
        }

        // the auction ended and the tokens will be transferred, so the token is not anymore on sale or the drop of the day
        token.onSale = false;
        token.isDropOfTheDay = false;
        tokens[_tokenId] = token;

        _transfer(ownerOf(_tokenId), winner, _tokenId);
    }

    function ahora() public view returns (uint256) {
        return now;
    }
}
